class Solution(object):
    def canConstruct(self, ransomNote, magazine):
        """
        :type ransomNote: str
        :type magazine: str
        :rtype: bool
        """
        # Time exceed
        # if ransomNote is None or magazine is None:
        #     return False
        #
        # ransom = list(ransomNote)
        # maga = list(magazine)
        #
        # for i in ransom:
        #     if maga.count(i) < ransom.count(i):
        #         return False
        # return True

        if ransomNote is None or magazine is None:
            return False
        ran = []
        maga = []
        for i in range(0, 26):
            ran.append(0)
            maga.append(0)
        for i in ransomNote:
            ran[ord(i)-97] += 1
        for i in magazine:
            maga[ord(i)-97] += 1
        for i in range(0, 26):
            if ran[i] > maga[i]:
                return False
        return True


